import { Grid} from '@mui/material';

function GridLayout() {
  return (
    <div>
      <Grid container spacing={2}>
        <Grid item xs={8}>
          <p>hi</p>
        </Grid>
      </Grid>
    </div>
  );
}

export default GridLayout;
